import React from 'react'
import AppBar from '@material-ui/core/AppBar'

function TopBar(props)
{
    return(
        <AppBar 
        position="sticky">

            <h1 id="header-title">{props.name}</h1>
        </AppBar>
    )
}

export default TopBar
